import React from 'react';
import { Caraousel, ChooseUs, BestDealCaraousel } from '../../components';
const Home = () => {
  return (
    <div>
      <Caraousel />
      <BestDealCaraousel />
      <ChooseUs />
    </div>
  );
};

export default Home;
